import React from "react";
import * as S from "./style";

function Input(props) {
  return (
    <S.Wrap>
      <input
        name={props.name}
        onClick={props.onClick}
        type={props.type || "text"}
        placeholder={props.title + "을 입력해주세요 "}
        onChange={props.onChange}
        value={props.value}
      />
    </S.Wrap>
  );
}

export default Input;
